export async function getMyProducts(){

    try{
        const response = await fetch("http://localhost:3333/myProducts",{
        method: "GET",
            headers: {
            accept: 'application/json',
            },
        });

        if(!response.ok){
            throw new Error(`Error status: ${response.status}`)
        }
        const result = await response.json();
        return result;

    }catch(err){
        console.log(err);
    }


    return '';
}

